import React from 'react';
import { Link } from 'react-router-dom';

import { useAuth } from './AuthContext';


interface Props {
    isAuthenticated: boolean;
}

// Header
const Header: React.FC<Props> = ({ isAuthenticated }) => {
    const { logout } = useAuth();
    return (<header className="text-white py-1 px-6 flex items-center justify-between" style={{ backgroundColor: '#000048' }}>
        <div className="flex items-center gap-4">
            {/* Replace with your company logo */}
            <img src="./cts-logo3.png" alt="Logo" className="logo" width="100%" />
        </div>
        {isAuthenticated ? (
            <div className="flex items-end gap-4 h-16">
                <nav>
                    <Link className="nav-link" to="/home">Home</Link> |
                    <Link className="nav-link" to="/about-tool">About Tool</Link> |
                    <Link className="nav-link" to="/migration">Migration Page</Link> |
                    <button className="nav-link" onClick={logout} style={{ width: '60px' }}>Logout</button>
                </nav>
            </div>
        ) : (<a href="/login">Login</a>)}
    </header>
    );
};

export default Header;
